dic = {}
res = set()
for i in nums:
    dic[i] = dic.get(i,0)+1
nums.sort()
for i in range(len(nums)):
    if i != 0 and nums[i-1] == nums[i]:
        continue
    dic[nums[i]] -=1
    for j in range(i+1,len(nums)):
        dic[nums[j]]-=1
        if dic.get(0-nums[i]-nums[j],0):
            tmp = sorted([nums[i],nums[j],0-nums[i]-nums[j]])
            
            res.add(tuple(tmp))
        dic[nums[j]]+=1
    dic[nums[i]]+=1
